        print('raw_avg = ' + str(raw_average))
        print('V_measured = ' + str(self.adc_V_lookup[round(raw_average)]))
    
        # Convert to resistance
        raw_average = self.ADC_MAX * self.adc_V_lookup[round(raw_average)]/self.ADC_Vmax
