        print('Thermistor resistance: {} ohms'.format(resistance))
    
        # Convert to temperature
        steinhart  = math.log(resistance / self.NOM_RES) / self.THERM_B_COEFF
        steinhart += 1.0 / (self.TEMP_NOM + 273.15)
        steinhart  = (1.0 / steinhart) - 273.15
        return steinhart